В производстве косметики компания придерживается строгих правил:
честные составы продуктов на основе преимущественно растительных ингредиентов, выращенных в России;
косметика не содержит продукты нефтехимии, минеральные масла, SLS, SLES и парабены, а также имеет полностью биоразлагаемую формулу;
только безопасные консерванты, разрешенные международными эко стандартами;
экологически чистое производства и бережное отношение к окружающей среде.
